import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { AuthProvider } from "./Context/AuthContext";


import Home from "./Pages/Home";
import Book from "./Pages/Book";
import Login from "./Pages/Login";
import Signup from "./Pages/Signup";
import Results from "./Pages/result";
import Footer from "./Components/Footer";
import BookByCity from "./Pages/BookByCity";
import BookDetails from "./Pages/BookDetails";
import Navbar from "./Components/Navbar";
import Mystery from "./Pages/Mystery";

const App = () => {
  return (
    <Router>
      <AuthProvider>
        <Navbar/>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/book" element={<Book/>} />
        <Route path="/book/:_id" element={<BookDetails/>}/>
        <Route path="/book/:city" element={<BookByCity/>}/>
        <Route path="/book/:login" element={<Login/>}/>
        <Route path="/book/:signup" element={<Signup/>}/>
        <Route path="/results/cityResponse/:city" element={<Results/>}/>
        <Route path="/results/:booktype" element={<Results/>}/>
        <Route path="/Mys/:id" element={<Mystery />} />

      </Routes>
       <Footer/> 
      </AuthProvider>
    </Router>
  );
};

export default App;
